    <main class="s-home s-home--static">

        <div class="overlay"></div>

        <div id="home" style="padding-top: 3rem;" class="home-content">
            <div style="padding-top: 3rem;" class="row home-content__main">

                <div class="col-eight home-content__text">
                    <h1>
                        generate an encrypted key<br>
                    </h1>

                    <p id="tt" style="margin-top: 3rem;">
                        do not copy paste for no reason, click to copy and paste<br>
                        <a onclick="navigator.clipboard.writeText(document.getElementById('key').innerHTML); alert('copied') "

                    </p>
                </div>
            </div>

            <div style="background-color: #974557" class="home-content__line"></div>

            </div>

        </div>
    </main>
